import React from 'react';
import { Card, Tag, Badge, Tooltip } from 'antd';
import { CheckCircleOutlined, ExclamationCircleOutlined, HeartOutlined, TrophyOutlined } from '@ant-design/icons';
import moment from 'moment';

const EventCard = ({ event, onClick, showDecisionIndicator = false }) => {
  const getTopicColor = (category) => {
    const colors = {
      'exercise': 'blue',
      'nutrition': 'green',
      'sleep_recovery': 'purple',
      'labs': 'orange',
      'admin': 'default',
      'travel': 'cyan',
      'cognition': 'magenta',
      'risk_decision': 'red',
      'wearables_data': 'geekblue',
      'msk': 'volcano'
    };
    return colors[category] || 'default';
  };

  const getRoleColor = (role) => {
    const colors = {
      'Member': 'blue',
      'Concierge': 'green',
      'Medical Strategist': 'red',
      'Physiotherapist': 'orange',
      'Nutritionist': 'purple',
      'Performance Scientist': 'cyan',
      'Concierge Lead': 'gold'
    };
    return colors[role] || 'default';
  };

  const getPriorityIcon = (priority) => {
    switch(priority) {
      case 'High': return <ExclamationCircleOutlined style={{ color: '#ff4d4f' }} />;
      case 'Medium': return <CheckCircleOutlined style={{ color: '#faad14' }} />;
      default: return null;
    }
  };

  const hasHealthMetrics = event.metrics.sleep_hours || event.metrics.bp || event.metrics.adherence_pct;

  return (
    <Card 
      size="small" 
      hoverable 
      onClick={() => onClick && onClick(event)}
      style={{ 
        cursor: onClick ? 'pointer' : 'default',
        borderLeft: event.decision.taken ? '4px solid #52c41a' : '4px solid transparent'
      }}
      title={
        <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center' }}>
          <span style={{ fontSize: '12px', color: '#666' }}>
            {moment(event.timestamp).format('MMM DD, HH:mm')}
          </span>
          {event.why.priority && getPriorityIcon(event.why.priority)}
        </div>
      }
    >
      {showDecisionIndicator && event.decision.taken && (
        <Badge 
          status="success" 
          text="Decision"
          style={{ position: 'absolute', top: 8, right: 8, fontSize: '10px' }}
        />
      )}

      <div style={{ marginBottom: 8 }}>
        <Tag color={getRoleColor(event.actor.role)} size="small">
          {event.actor.sender}
        </Tag>
        <Tag color={getTopicColor(event.topic.category)} size="small">
          {event.topic.category}
        </Tag>
        {event.travel.flag && (
          <Tag color="cyan" size="small">‚úàÔ∏è {event.travel.region}</Tag>
        )}
      </div>

      <div style={{ marginBottom: 8, minHeight: 40 }}>
        {Array.isArray(event.content.summary) && event.content.summary.length > 0 ? (
          <div>
            {event.content.summary.slice(0, 2).join(' ')}
            {event.content.summary.length > 2 && '...'}
          </div>
        ) : (
          <div style={{ color: '#999', fontSize: '12px' }}>
            {event.content.details?.substring(0, 100) || 'No summary available'}...
          </div>
        )}
      </div>

      {/* Health Metrics */}
      {hasHealthMetrics && (
        <div style={{ marginBottom: 8, padding: 4, backgroundColor: '#f0f0f0', borderRadius: 4 }}>
          {event.metrics.sleep_hours && (
            <Tag size="small" color="blue">üò¥ {event.metrics.sleep_hours}h</Tag>
          )}
          {event.metrics.bp && (
            <Tag size="small" color="red">ü©∫ {event.metrics.bp}</Tag>
          )}
          {event.metrics.adherence_pct !== null && (
            <Tag size="small" color={event.metrics.adherence_pct > 70 ? 'green' : 'orange'}>
              üìä {event.metrics.adherence_pct}%
            </Tag>
          )}
          {event.metrics.hrv_flag && (
            <Tag size="small" color="purple">‚ù§Ô∏è HRV</Tag>
          )}
        </div>
      )}

      {/* Biomarkers */}
      {event.topic.biomarkers.length > 0 && (
        <div style={{ marginTop: 8 }}>
          {event.topic.biomarkers.slice(0, 3).map(biomarker => (
            <Tag key={biomarker} size="small" color="orange">
              <HeartOutlined /> {biomarker}
            </Tag>
          ))}
          {event.topic.biomarkers.length > 3 && (
            <Tag size="small">+{event.topic.biomarkers.length - 3} more</Tag>
          )}
        </div>
      )}

      {/* Training Flags */}
      <div style={{ marginTop: 8 }}>
        {event.training_flags.zone2 && <Tag size="small" color="blue">Zone 2</Tag>}
        {event.training_flags.strength && <Tag size="small" color="green">Strength</Tag>}
        {event.training_flags.intervals && <Tag size="small" color="red">Intervals</Tag>}
        {event.training_flags.exercise_refresh && (
          <Tag size="small" color="purple"><TrophyOutlined /> Refresh</Tag>
        )}
        {event.training_flags.diagnostic_event && (
          <Tag size="small" color="orange">üß™ Labs</Tag>
        )}
      </div>

      {/* Rationale Preview */}
      {event.why.rationale && (
        <div style={{ 
          marginTop: 8, 
          fontSize: '11px', 
          color: '#666', 
          fontStyle: 'italic',
          borderTop: '1px dotted #d9d9d9',
          paddingTop: 4
        }}>
          üí≠ {event.why.rationale.substring(0, 60)}...
        </div>
      )}
    </Card>
  );
};

export default EventCard;
